content:
머리 푼 대방마님 세상 청순하다 캄서 보고 있었는데....
&quot;있어도 없어야할것입니다&quot;
뭔데 뭔데~~ 완전 고수잖아~~ ㅋㅋㅋ

그렇게 억울하게 죽었는데도 우리 분이라고 ㅜㅜ;
복수도 하고싶고 분이도 살리고 싶어서 환생한건가요...
그나저나 전생에서 웬수사이가 부부가되다니...
그래서 부부는 웬수 인건가;;;

이 이기적이고 나쁜 나무꾼 놈아....너와 비슷한 상황에서 전혀 다른 선택을 한 돌쇠를 아느냐!!
돌쇠라고 어찌 한자락 욕심이 없었을까...하지만, 그는 자신의 감정이나 행복보다 아기씨의 행복을 우선했기 때문에, 두 사람은 각각 행복해 졌다.
그런데, 네놈은 그 추하고 이기적인 욕심으로 도대체 몇 사람의 인생을 망친것이냐...쯧쯧쯧~~~ --_--;;

응....?바다는 소금물아니오...?
물이부족한 나무한테 바닷물은 
독이 될것같은데;;;;

&#x27;강간 미수는 곤장 100대, 유배 1천 리의 벌을 받는 죄다, 이 쓰레기 새끼.&#x27;
다음편에서는 안나올 엑스트라(?) 인물의 대사지만, 정말 시원한 대사다.
피해자들한테는 전혀 위로가 안되겠지만...

작가님~&quot;
만나뵈게 되어서 넘넘 좋아요~^0^
항상 응원하고, 응원합니다~&quot;
뽜잇팅~&quot;^0^
